import React, { Component } from "react";
const { useState } = React;

class Fib extends Component {
  render() {
    const[k, setValue]=useState(0);
    const handleChange = (e) => setValue(e.target.value);
    return (
      <div>
        <h2>Kalkulator n-go wyrazu ciÄ…gu Fibonacciego</h2>
        <input type="number" value={k} onChange={handleChange}/><br/>
        {printFib(k)}
      </div>
    );
  }
}

function printFib(k)
{
  var fib_val=fib(k);
  return(
    <div>
      wYNIK: {fib_val}
    </div>
  );
}
function fib(k)
{
  if(k==0)
  {
    return 0;
  }
  else if(k==1)
  {
    return 1;
  }
  else if(k>=130 || k<0)
  {
    return;
  }
  else
  {
    return fib(k-1)+fib(k-2);
  }
}

export default Fib;
